import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { registerInternship } from '../../services/studentApi';
import { toast } from 'react-hot-toast';
import Button from '../../components/UI/Button';
import Input from '../../components/UI/Input';

const RegisterInternship = () => {
  const [formData, setFormData] = useState({
    company_name: '',
    position: '',
    start_date: '',
    end_date: '',
    supervisor_name: '',
    supervisor_email: '',
    supervisor_phone: '',
    description: '',
    work_hours: '',
    location: '',
    is_remote: false,
    skills_required: '',
  });

  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      // Validate dates
      const startDate = new Date(formData.start_date);
      const endDate = new Date(formData.end_date);

      if (endDate <= startDate) {
        toast.error('End date must be after start date');
        return;
      }

      await registerInternship(formData);
      toast.success('Internship registration successful!');
      navigate('/dashboard');
    } catch (error) {
      console.error('Internship registration error:', error);
      toast.error(error.message || 'Failed to register internship');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-4xl mx-auto py-6 sm:px-6 lg:px-8">
      <div className="bg-white shadow-sm rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <h1 className="text-2xl font-semibold text-gray-900 mb-6">
            Register for Internship
          </h1>

          <form onSubmit={handleSubmit} className="space-y-6">
            <div className="grid grid-cols-1 gap-6 sm:grid-cols-2">
              <Input
                label="Company Name"
                name="company_name"
                value={formData.company_name}
                onChange={handleChange}
                required
              />

              <Input
                label="Position"
                name="position"
                value={formData.position}
                onChange={handleChange}
                required
              />

              <Input
                label="Start Date"
                type="date"
                name="start_date"
                value={formData.start_date}
                onChange={handleChange}
                required
              />

              <Input
                label="End Date"
                type="date"
                name="end_date"
                value={formData.end_date}
                onChange={handleChange}
                required
              />

              <Input
                label="Supervisor Name"
                name="supervisor_name"
                value={formData.supervisor_name}
                onChange={handleChange}
                required
              />

              <Input
                label="Supervisor Email"
                type="email"
                name="supervisor_email"
                value={formData.supervisor_email}
                onChange={handleChange}
                required
              />

              <Input
                label="Supervisor Phone"
                type="tel"
                name="supervisor_phone"
                value={formData.supervisor_phone}
                onChange={handleChange}
                required
              />

              <Input
                label="Work Hours (per week)"
                type="number"
                name="work_hours"
                value={formData.work_hours}
                onChange={handleChange}
                required
                min="1"
                max="40"
              />

              <Input
                label="Location"
                name="location"
                value={formData.location}
                onChange={handleChange}
                required
              />

              <div className="flex items-center">
                <input
                  type="checkbox"
                  name="is_remote"
                  id="is_remote"
                  checked={formData.is_remote}
                  onChange={handleChange}
                  className="h-4 w-4 text-primary-600 focus:ring-primary-500 border-gray-300 rounded"
                />
                <label htmlFor="is_remote" className="ml-2 block text-sm text-gray-900">
                  Remote Work
                </label>
              </div>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700">
                Skills Required
              </label>
              <textarea
                name="skills_required"
                rows={3}
                value={formData.skills_required}
                onChange={handleChange}
                className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-primary-500 focus:border-primary-500 sm:text-sm"
                placeholder="List the required skills..."
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700">
                Description
              </label>
              <textarea
                name="description"
                rows={4}
                value={formData.description}
                onChange={handleChange}
                className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-primary-500 focus:border-primary-500 sm:text-sm"
                placeholder="Describe the internship role and responsibilities..."
                required
              />
            </div>

            <div className="flex justify-end space-x-3">
              <Button
                type="button"
                variant="outline"
                onClick={() => navigate('/dashboard')}
              >
                Cancel
              </Button>
              <Button
                type="submit"
                variant="primary"
                loading={loading}
              >
                Register Internship
              </Button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default RegisterInternship;
